function checkEligibility() {
  const wallet = document.getElementById("wallet").value.trim().toLowerCase();
  const result = document.getElementById("result");

  if (whitelist.map(w => w.toLowerCase()).includes(wallet)) {
    result.innerHTML = " You are Whitelisted!";
    result.style.color = "#00ff99";
  } 
  else if (gtdlist.map(w => w.toLowerCase()).includes(wallet)) {
    result.innerHTML = " You have GTD Spot!";
    result.style.color = "#00ccff";
  } 
  else {
    result.innerHTML = " Not Eligible";
    result.style.color = "red";
  }
}
